import React from 'react';
import './MenuItem.css';
import { Card } from 'reactstrap';

const MenuItem = ({ image, title, link }) => {
  return (
    <div>
      <Card.Img variant='top' src={image} />
      <Card.Body>
        <Card.Title>{title}</Card.Title>
        <Card.Title>{link}</Card.Title>
      </Card.Body>
    </div>
  );
};

export default MenuItem;
